import { React, lazy, Suspense } from "react";
import { BrowserRouter, Switch, Route, Routes } from "react-router-dom";
import ComponentLoading from "../components/ComponentLoading";
import PageLoading from "../components/PageLoading";

import { Home, Login, Signup, Verification, FirstPage } from "../pages/index";

import ScrollIntoView from "./ScrollIntoView";

const PrivateRoute = lazy(() => import("./PrivateRoute"));
const PublicRoute = lazy(() => import("./PublicRoute"));
const PrivateRouteFood = lazy(() => import("./PrivateRouteFood"));
const PublicRouteFood = lazy(() => import("./PublicRouteFood"));
const App = () => {
  return (
    <BrowserRouter>
      <ScrollIntoView>
        <Suspense fallback={<PageLoading />}>
          <Switch>
            <PublicRoute restricted={true} component={Home} path="/" exact />{" "}
            <PublicRoute
              restricted={true}
              component={Home}
              path="/home"
              exact
            />
            {/* Global */}
            <Route restricted={true} component={FirstPage} path="/" exact />
            <Route restricted={true} component={Login} path="/login" exact />
            <Route restricted={true} component={Signup} path="/signup" exact />
            <Route
              restricted={true}
              component={Verification}
              path="/verification/:phone"
              exact
            />
            <PublicRoute component={Home} path="*" />
            {/* <Route path="*" component={Home} /> */}
          </Switch>
        </Suspense>
      </ScrollIntoView>
    </BrowserRouter>
  );
};

export default App;
